import React from 'react';
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';
import { CardActionArea } from '@mui/material';
import CardMedia from '@mui/material/CardMedia';
import LocationOnIcon from '@mui/icons-material/LocationOn';
import StarIcon from '@mui/icons-material/Star';
export default function House(props) {
  const itemtitle={
    fontSize:"18px",
    fontWeight : 'bold',
    marginTop: "20px"
  }
  return (
      <div className=" flex p-3 rounded-lg  hover:shadow-lg ease-linear transition-all  ">

          <div className="flex ">
            <picture className="max-w-[220px]  aspect-square m-2">
              <img
                src={`${props.url}`}
                loading="lazy"
                className="w-full h-full  shadow-lg object-cover"
              />
            </picture>
            <div className="item-title " style={itemtitle}>{props.name}</div>
            <div className="item-title " style={itemtitle}><LocationOnIcon/>台北市</div>
            <StarIcon color="secondary"  style={itemtitle}/>{props.score.toFixed(1)}
          </div>

      </div>
  );
}
